class KvActivity : AppCompatActivity() {

    private val binding by lazy { ActivityKvBinding.inflate(layoutInflater) }

    val corePuffer = AndroidPufferDB.withDefault()

    val pufferFile = AndroidPufferDB.getInternalFile("my.db")
    val coroutinePuffer = CoroutinePufferDB.with(pufferFile)


    override fun onCreate(savedInstanceState: Bundle?) {
        WindowCompat.setDecorFitsSystemWindows(window, false)
        super.onCreate(savedInstanceState)
        setContentView(binding.root)

        binding.button.setOnClickListener {

            measureTimeMillis {
                val test = SpUtil("test").decodeString("test", "test")
                Timber.tag("xihantest").d("test:${test.length}")
            }.run { Timber.tag("xihantest").d("SpUtil-读取运行时间:%s", this) }
            measureTimeMillis {
                val test = corePuffer.get("test", "test")
                Timber.tag("xihantest").d("test:${test.length}")
            }.run { Timber.tag("xihantest").d("corePuffer-读取运行时间:%s", this) }
            lifecycleScope.launch(Dispatchers.IO) {
                measureTimeMillis {
                    val test = coroutinePuffer.get("test", "test")
                    Timber.tag("xihantest").d("test:${test.length}")
                }.run { Timber.tag("xihantest").d("coroutinePuffer-读取运行时间:%s", this) }
            }
        }

        binding.button2.setOnClickListener {
            measureTimeMillis {
                SpUtil("test").encode("test", getJson())
            }.run { Timber.tag("xihantest").d("SpUtil-写入运行时间:%s", this) }

            measureTimeMillis {
                corePuffer.put("test", getJson())
            }.run { Timber.tag("xihantest").d("corePuffer-写入运行时间:%s", this) }

            lifecycleScope.launch(Dispatchers.IO) {
                measureTimeMillis {
                    coroutinePuffer.put("test", getJson())
                }.run { Timber.tag("xihantest").d("coroutinePuffer-写入运行时间:%s", this) }
            }
        }

        binding.button3.setOnClickListener {
            lifecycleScope.launch(Dispatchers.IO) {
                SpUtil("test").clearAll()
                corePuffer.removeAll()
                coroutinePuffer.removeAll()
            }
        }


    }

}

